import React from "react";
import "./styles.css";
import { Link, Switch, Route, BrowserRouter as Router } from "react-router-dom";
import Listout from "./Listout";
import Formfilled from "./Formfilled";

export default function App() {
  return (
    <div className="App">
      <h1>Router multi-step navigation test</h1>
      <Router>
        <Switch>
          <Route exact path="/">
            <Link to="/Formfilled">Form</Link>
          </Route>
          <Route path="/Formfilled">
            <Formfilled />
          </Route>
          <Route path="/Listout">
            <Listout />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}
